import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Import Styles
import './styles/variables.css';
import './styles/reset.css';
import './styles/utils.css';
import './styles/animations.css';
import './styles/globals.css';
import './App.css';

// Import Components
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import HeroBackground from './components/HeroBackground';
import ProtectedRoute from './components/ProtectedRoute';

// Import Pages
import HomePage from './pages/HomePage';
import TechnicalEventsPage from './pages/TechnicalEventsPage';
import CulturalEventsPage from './pages/CulturalEventsPage';
import RegistrationPage from './pages/RegistrationPage';
import ContactPage from './pages/ContactPage';
import CreditsPage from './pages/CreditsPage';
import AdminLogin from './pages/AdminLogin';
import AdminDashboard from './pages/AdminDashboard';

function App() {
  return (
    <Router>
      <div className="App">
        <HeroBackground />
        
        <Navbar />
        
        <main>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/technical-events" element={<TechnicalEventsPage />} />
            <Route path="/cultural-events" element={<CulturalEventsPage />} />
            <Route path="/register" element={<RegistrationPage />} />
            <Route path="/contact" element={<ContactPage />} />
            <Route path="/credits" element={<CreditsPage />} />
            <Route path="/admin-login" element={<AdminLogin />} />
            <Route 
              path="/admin-dashboard" 
              element={
                <ProtectedRoute>
                  <AdminDashboard />
                </ProtectedRoute>
              } 
            />
          </Routes>
        </main>
        
        <Footer />
        
        {/* Accessibility Skip Link */}
        <a href="#main" className="skip-link">Skip to content</a>
      </div>
    </Router>
  );
}

export default App;
